import { all, call, put, takeLatest } from "redux-saga/effects";
import { CartActionTypes } from "./cart.types";

export function* onClearCart() {
    yield takeLatest(
        CartActionTypes.CLEAR_CART
    )
}

export function* cartSagas() {
    yield all([
        call(onClearCart)
    ])
}
